  // console.log(data); function BusinessList(data) -> {[{...},{...},{...}]}
  console.log(data) //구조분해 후, [{...}, {...}, {...}, {...}]
  return(
    <ul className={styles.businessList}>
      {
        data.map()
      }
      <BusinessItem />    
  </ul>
  );
}

export default BusinessList;
